function setActiveDay() {
    var selected = false;
    if (!$('.fc-day-today').hasClass('no-events')) {
        $('.fc-day-today .fc-daygrid-day-number').click();
    } else {
        $('.fc-day-future').each(function(i, elem) {
            if (!$(elem).hasClass('no-events')) {
                if (!selected) {
                    $(elem).find('.fc-daygrid-day-number').click();
                    selected = true;
                }
            }
        });
    }

    if (!selected) {
        calendar.next();
        setEmptyClass();

        $('.fc-day-future').each(function(i, elem) {
            if (!$(elem).hasClass('no-events')) {
                if (!selected) {
                    $(elem).find('.fc-daygrid-day-number').click();
                    selected = true;
                }
            }
        });
    }
}

